import React, { useState } from 'react';
import './matchcard.css';
import PropTypes from 'prop-types';
import { motion, useMotionValue, useTransform, useAnimation } from 'framer-motion';

const MatchCard = ({ id, name, classification, matchimage, bio, courses, interests, removeCard }) => {
    const motionValue = useMotionValue(0);
    const rotateValue = useTransform(motionValue, [-200, 200], [-15, 15]);
    const opacityValue = useTransform(
        motionValue,
        [-200, -150, 0, 150, 200],
        [0, 1, 1, 1, 0]
    );
    const animControls = useAnimation();
    const [isHidden, setIsHidden] = useState(false);

    const handleDragEnd = (event, info) => {
        if (Math.abs(info.offset.x) > 150) {
            // Swipe action completed
            setIsHidden(true);
            setTimeout(() => removeCard(id), 300);
        } else {
            // Return to center
            animControls.start({ x: 0, rotate: 0 });
        }
    };

    const handleSwipe = (direction) => {
        const swipeDistance = direction === 'right' ? 200 : -200;
        animControls.start({
            x: swipeDistance,
            rotate: direction === 'right' ? 15 : -15,
            opacity: 0,
            transition: { duration: 0.5 }
        });
        setIsHidden(true);
        setTimeout(() => removeCard(id), 500);
    };

    return (
        <motion.div
            className={`dbMatchBox ${isHidden ? 'hidden' : ''}`}
            drag="x"
            style={{
                x: motionValue,
                rotate: rotateValue,
                opacity: opacityValue,
            }}
            dragConstraints={{ left: -200, right: 200 }}
            onDragEnd={handleDragEnd}
            animate={animControls}
            initial={{ scale: 0.95, opacity: 0 }}
            exit={{ scale: 0.8, opacity: 0 }}
            transition={{ type: 'spring', stiffness: 300, damping: 20 }}
        >
            <div className="dbMatchImgBox">
                <img className="dbCurrentMatch" src={matchimage} alt="Current Match" />
                <h1 className="dbMatchName">{name}</h1>
                <p className="dbMatchYear">{classification}</p>
            </div>

            <div className="dbMatchInfo">
                <div className="dbBio">
                    <div className="dbTitle">About Me</div>
                    <div className="dbBioInfo">{bio}</div>
                </div>

                <div className="dbCourses">
                    <div className="dbTitle">Courses</div>
                    <div className="dbCoursesInfo">
                        {courses.map((course, index) => (
                            <div className="dbListElements" key={index}>
                                {course}
                            </div>
                        ))}
                    </div>
                </div>

                <div className="dbInterests">
                    <div className="dbTitle">Interests</div>
                    <div className="dbInterestsInfo">
                        {interests.map((interest, index) => (
                            <div className="dbListElements" key={index}>
                                {interest}
                            </div>
                        ))}
                    </div>
                </div>
            </div>

            <div className="dbButtons">
                <button 
                    className="dbnoButton" 
                    onClick={() => handleSwipe('left')}
                    aria-label="Decline match"
                >                </button>
                <button 
                    className="dbyesButton" 
                    onClick={() => handleSwipe('right')}
                    aria-label="Accept match"
                >
                </button>
            </div>
        </motion.div>
    );
};

MatchCard.propTypes = {
    id: PropTypes.oneOfType([PropTypes.string, PropTypes.number]).isRequired,
    name: PropTypes.string.isRequired,
    classification: PropTypes.string.isRequired,
    matchimage: PropTypes.string.isRequired,
    bio: PropTypes.string.isRequired,
    courses: PropTypes.arrayOf(PropTypes.string).isRequired,
    interests: PropTypes.arrayOf(PropTypes.string).isRequired,
    removeCard: PropTypes.func.isRequired,
};

export default MatchCard;
